import React, {useEffect, useState} from "react";
import popWindow from 'reactjs-popup';

function Popup(){

    const [backendData, setBackendData] = useState([{}])
    useEffect(() => {
        fetch("./validate").then(
            response => response.json()
        ).then(
            data => {setBackendData(data)}
        )
    })

    return (
        <p>{backendData}</p>

    )
}

export default Popup
